import React from "react";
import "./Button.css";

const STYLES = [
    "btn-primary-solid",
    "btn-warning-solid",
    "btn-danger-solid",
    "btn-success-solid",
    "btn-primary-outline",
    "btn-primary-outline",
    "btn-primary-outline",
    "btn-primary-outline"

]
export const Button = ({
    children,
    type,
    onClick,
    buttonStyle,
    buttonSize,
}) => {
    return (
        <button onClick={onClick} tpye={type}> 
            {children}
        </button>
    )
};
